import React from 'react'
import { Form } from 'react-bootstrap';

export default function FederationForm(federations){
  return (
    <div>
      <Form>
        { federations?.map(federation => {
          <Form.Check
            type="switch"
            id="custom-switch"
            label={federation}
            />
          })
        }
      </Form>
    </div>
  )
}
